import React from 'react';
import { View, Text, Image, StyleSheet} from 'react-native';
import Icon from '../assets/Food.png';
import { MaterialIcons } from '@expo/vector-icons';
import { Foundation } from '@expo/vector-icons';
import { MaterialCommunityIcons } from '@expo/vector-icons';
import { Entypo } from '@expo/vector-icons';

function Cart(props) {
    const data=props.data 
    return (
        <View style={{
            height: 190,
            margin: 10,

            shadowOffset: {
                height: 1,
                width: 1,
            },
            shadowColor: "black",
            shadowRadius: 10,
            elevation: 10,
            shadowOpacity: .5,
            borderRadius: 10,
            padding: 10,
            flexDirection: 'row',
            backgroundColor: 'white',
        }}>
            <View style={{
                alignItems: 'center',
                flex:2,
                height: '100%',
                
                justifyContent: 'center',
                alignItems: 'center',


            }}>
                <Image style={{
                    height: 100,
                    width: 100,
                }} source={{uri:data.Image}} />
            </View>
            <View style={{
               flex:3,
                margin: 10,
            }}>
                <Text style={{
                    fontSize: 15,
                    fontWeight: '500',


                }}>
                    Multiple fast food item
                </Text>
                <Text style={{
                   color:'#808080',
                    fontWeight: 'normal',
                    marginTop:5,
                    


                }}>
                    This food item is offering at your service, you can buy it instantly.
                </Text>
                <View style={styles.box}>
                <MaterialIcons style={{
                    flex:1,
                }} name="directions-railway" size={20} color="black" /> 
                    <Text style={{
                        
                        flex:7,
                    }}>
                        {data.RailName}
                    </Text>
                </View>
                <View style={styles.box}>
                <Entypo style={{
                    flex:1,
                }} name="price-tag" size={20} color="#1C2348" />
                    <Text style={{
                        
                        flex:7,
                    }}>
                        {data.tk} tk
                    </Text>
                </View>
                <View style={styles.box}>
                <MaterialCommunityIcons  style={{
                    flex:1,
                }} name="format-list-numbered" size={20} color="black" /> 
                    <Text style={{
                        
                        flex:7,
                    }}>
                        {data.Order} total order
                    </Text>
                </View>
            </View>

        </View>
    );
}

export default Cart;
const styles=StyleSheet.create({
    box:{
        flexDirection:'row',
        marginTop:5,
        width:'100%',
    }
})
